import React from "react";

function Show() {
  return (
    <div>
      <h1
        style={{
          marginLeft: "10px",
          marginTop: "10px",
          marginBottom: "10px",
          fontSize: "30px",
          fontWeight: "bold",
          color: "white",
          textShadow: "2px 2px black",
          textTransform: "uppercase",
          letterSpacing: "2px",
          //   backgroundColor: "#2d2d2d",
          padding: "10px",
          borderRadius: "10px",
          boxShadow: "0px 0px 10px black",
        }}
      >
        Trending Searches Right Now
      </h1>
    </div>
  );
}

export default Show;
